import React, { Component } from 'react';

class Modal extends React.Component {

    render() {
      const { display, close, children } = this.props;
      if (!display) return null;
      return (
        <div className="modal">
          {children}
          <button onClick={close}>Close</button>
        </div>
        )
    }
  }


  export default Modal;
